import './App.css';
import NoteContainer from './components/note_container/NoteContainer';
import Sidebar from './components/sidebar/Sidebar';

function App() {

  const notes = [
    {
      title: "note1",
      text: "abcd",
      time: "3:30AM",
      color: "cyan"
    },
    {
      text: "abcd",
      time: "3:30AM",
      color: "yellow"
    },
    {
      text: "abcd",
      time: "3:30AM",
      color: "cyan"
    },
    {
      text: "abcd",
      time: "3:30AM",
      color: "green"
    },
    {
      text: "abcd",
      time: "3:30AM",
      color: "cyan"
    }
  ]

  return (
    <>
      <div className="app_main">
        <Sidebar />
        <NoteContainer  notes={notes} />
      </div>
    </>
  );
}

export default App;
